html:
{% for i in doc.barcode_printer_items %}
<h3>الاسم</h3>
<img src="https://bwipjs-api.metafloor.com/?bcid=code128&text={{ i.printer_barcode }}&includetext" height="60" width="200">
{% if doc.receipt_supplier_id or doc.receipt_supplier_id == None %}
<p>{{ i.item_batch }}/{{ doc.receipt_supplier_id }}---{{ frappe.db.get_value("Item Price", {"item_code":i.item_code,"price_list":"Standard Selling"}, "price_list_rate") }}</p>
{% endif %}
{% if doc.invoice_supplier_id or doc.invoice_supplier_id == None %}
<p>{{ i.item_batch }}/{{ doc.invoice_supplier_id }}---{{ frappe.db.get_value("Item Price", {"item_code":i.item_code,"price_list":"Standard Selling"}, "price_list_rate") }}</p>
{% endif %}
<div class="page-break"></div>
{% endfor %}
